// src/App.js - Versiunea completă cu suport pentru Google OAuth și accesibilitate
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import AuthSuccess from './components/AuthSuccess'; // Nou component pentru Google OAuth
import StarsBackground from './components/StarsBackground';
import { ToastProvider } from './components/ToastProvider';
import { AccessibilityProvider } from './providers/AccessibilityProvider';
import { useAccessibility } from './hooks/useAccessibility';
import AccessibilityIndicator from './components/AccessibilityIndicator';

// Import componente accesibile
import AccessibleMainPage from './components/AccessibleMainPage';
import AccessibleCoursesPage from './components/AccessibleCoursesPage';
import AccessibleCodePlayground from './components/AccessibleCodePlayground';
import AccessibleQuiz from './components/AccessibleQuiz';

// Import componente normale
import MainPage from './components/MainPage';
import CoursesPage from './components/CoursesPage';
import CourseDetailPage from './components/CourseDetailPage';
import Quiz from './components/Quiz';
import CodePlayground from './components/CodePlayground';

import './styles/theme.css';
import './App.css';

// Componentă wrapper pentru rutele care determină ce componentă să folosească
function RouteWrapper({ AccessibleComponent, NormalComponent, ...props }) {
  const { isAccessibilityMode } = useAccessibility();

  const ComponentToRender = isAccessibilityMode ? AccessibleComponent : NormalComponent;
  return <ComponentToRender {...props} />;
}

function AppContent() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const { isAccessibilityMode, announceNavigation } = useAccessibility();

  useEffect(() => {
    // Verificăm sessionStorage pentru token
    const token = sessionStorage.getItem('authToken');
    if (token) {
      setIsAuthenticated(true);
    }
  }, []);

  const handleLogout = () => {
    // Ștergem din sessionStorage
    sessionStorage.removeItem('authToken');
    sessionStorage.removeItem('userId');
    setIsAuthenticated(false);

    if (isAccessibilityMode) {
      announceNavigation('Deconectat cu succes. Redirecționez către pagina principală.');
    }
  };

  return (
    <Router>
      <div className="App">
        <StarsBackground />
        <AccessibilityIndicator />
        <Header isAuthenticated={isAuthenticated} onLogout={handleLogout} />

        <main className="main-content">
          <Routes>
            {/* Rută principală */}
            <Route 
              path="/" 
              element={
                <RouteWrapper 
                  AccessibleComponent={AccessibleMainPage}
                  NormalComponent={MainPage}
                />
              } 
            />

            {/* Rute de autentificare */}
            <Route 
              path="/login" 
              element={<Login setIsAuthenticated={setIsAuthenticated} />} 
            />
            <Route 
              path="/register" 
              element={<Register />} 
            />

            {/* Rută pentru succesul autentificării Google */}
            <Route 
              path="/auth/success" 
              element={<AuthSuccess setIsAuthenticated={setIsAuthenticated} />} 
            />

            {/* Rute protejate */}
            <Route 
              path="/courses" 
              element={
                <RouteWrapper 
                  AccessibleComponent={AccessibleCoursesPage}
                  NormalComponent={CoursesPage}
                />
              } 
            />
            <Route 
              path="/courses/:courseId/lesson/:lessonIndex" 
              element={<CourseDetailPage />} 
            />
            <Route 
              path="/quiz/:courseId/:lessonIndex" 
              element={
                <RouteWrapper 
                  AccessibleComponent={AccessibleQuiz}
                  NormalComponent={Quiz}
                />
              } 
            />
            <Route 
              path="/playground" 
              element={
                <RouteWrapper 
                  AccessibleComponent={AccessibleCodePlayground}
                  NormalComponent={CodePlayground}
                />
              } 
            />
            <Route 
              path="/profile" 
              element={<Profile />} 
            />
          </Routes>
        </main>

        <Footer />
      </div>
    </Router>
  );
}

function App() {
  return (
    <AccessibilityProvider>
      <ToastProvider>
        <AppContent />
      </ToastProvider>
    </AccessibilityProvider>
  );
}

export default App;
